import React from 'react'
import './Chart.css'
import ChartBar from './ChartBar'
const Chart = (props) => {
    return (
        <div className="chart">
           {props.dataPoints.map(dataPoint => <ChartBar value={dataPoint.value}/> )} 
        </div>
    )
}

export default Chart
